import React from 'react';
import './style.scss';

export default function Authors() {
    return (
        <div className='authors'>
            <div className='authors-paragraphs'>
            <p>Web Design: Paulina Dziobek</p>
            <p>Animation Source: <a href='https://codepen.io/jcoulterdesign'>Jamie Coulter</a></p>
            </div>
        </div>
    )
};
